import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <nav className="bg-blue-600 p-4 text-white flex gap-4">
      <Link to="/" className="hover:underline">Home</Link>
      <Link to="/additem" className="hover:underline">AddItem</Link>
      <Link to="/itemdetails" className="hover:underline">ItemDetails</Link>
      <Link to="/itemoffers" className="hover:underline">ItemOffers</Link>
      <Link to="/login" className="hover:underline">Login</Link>
      <Link to="/signup" className="hover:underline">SignUp</Link>
      <Link to="/user" className="hover:underline">User</Link>
      

    </nav>
  );
}

export default Navbar;
